import React from 'react';
import {Card,CardContent,Typography,Grid}from '@material-ui/core';
import CountUp from "react-countup";

import styles from'./Cards.module.css';
const Cards = ({data:{confirmed,recoverd, deaths,lastUpdate}}) => {
    if(!confirmed){
        return 'loading';
    }
    return ( 
     <div className={styleMedia.container }>
         <Grid container spacing ={3} justify="center">
             <Grid item component ={Card}>
                 <CardContent>
                     <Typography color="textSecondary" gutterBottom>Infected</Typography>
                     <Typography varaint>{confirmed.value}</Typography>
                     <Typography colr="textSecondary">REAL DATE</Typography>
                    <Typography variant='body2'>Number of active caused of Covied-19</Typography>

                 </CardContent>

             </Grid>
             <Grid item component ={Card}>
                 <CardContent>
                     <Typography color="textSecondary" gutterBottom>Recoverd</Typography>
                     <Typography varaint>REAL DATA</Typography>
                     <Typography colr="textSecondary">REAL DATE</Typography>
                    <Typography variant='body2'>Number of recoverd caused of Covied-19</Typography>

                 </CardContent>

             </Grid>

             <Grid item component ={Card}>
                 <CardContent>
                     <Typography color="textSecondary" gutterBottom>Deaths</Typography>
                     <Typography varaint>REAL DATA</Typography>
                     <Typography colr="textSecondary">REAL DATE</Typography>
                    <Typography variant='body2'>Number of deaths caused of Covied-19</Typography>

                 </CardContent>

             </Grid>


         </Grid>
     </div>
    );
}

export default Cards;
